import React from "react";
import Layout from "./Layout";
import Signin from "./Signin";
function Home() {
  return (
    <div>
      <Layout />
      <div className="row mt-4">
        <div className="col-md-6 custom-homepage-backgroundImage"></div>
        <div className="col-md-6">
          {" "}
          <Signin />{" "}
        </div>
      </div>
      <div className="row" style={{ backgroundColor: "#d9a7c7" }}>
        <div
          className="col-md-4 center-block text-center"
          style={{ display: "flex", flexFlow: "row", justifyContent: "center" }}
        >
          <h1 style={{ color: "#fffcdc", fontWeight: "bold" }}>
            THE ADVENTURE YOU HAVE{" "}
          </h1>
        </div>
        <div className="col-md-6 custom-homepage-backgroundImage-2"></div>
        <div className="col-md-2">
          <h1 style={{ color: "EDF5E1" }}> </h1>
        </div>
      </div>
    </div>
  );
}

export default Home;
